import React, { Fragment } from 'react';
import Navbar from './components/layout/Navbar';
import './App.css';
import MovieList from './components/MovieList';
import Search from './components/Search';

const App = () => {
  return (
    <Fragment>
      <Navbar />
      <Search />
      <MovieList />
    </Fragment>
  );
};

export default App;
